import React from 'react';

// Assuming 'UserID', 'author', and 'contact' could be dynamic, props or context could be used to pass these values
const About = ({ userID = '', author = 'J Kang', contact = 'kangjacob1@gmail.com' }) => {
  return (
    <section>
      <p>This application generates visual representations of Last.FM data.</p>
      <table>
        <tbody>
          <tr>
            <td>License:</td>
            <td>GNU Public</td>
          </tr>
          <tr>
            <td>Logged In User:</td>
            <td>{userID}</td>
          </tr>
          <tr>
            <td>Author:</td>
            <td>{author}</td>
          </tr>
          <tr>
            <td>Contact:</td>
            <td>{contact}</td>
          </tr>
        </tbody>
      </table>
    </section>
  );
};

export default About;
